InovaMo had one big desire before its inception: “Spread to the whole market, knowledge and culture in how to build predictive innovative decisions based on data”. Concerning to this premise, we started this company that works on statistical models and analysis through a variety of fields, improving client’s indicators.

Main goals that InovaMo pursue:
•	Improve client’s indicators using data, statistical techniques and strategies;
•	Spread culture of using historical data to predict events;
•	Share knowledge to our clients and create innovative environment;
•	Prove the high value of predictable decisions;
•	Popularize statistical methods and strategies;
•	Improve client’s lifecycle with a different view;
•	Deploy A/B tests to our client’s process;
•	Increase the capability of adopt quick strategies.
